  namespace: System.Net.Http.Headers
  summary: "\n<p>Represents a value which can either be a product or a comment in a User-Agent header.</p>\n"
  remarks: "\n<p>The <xref href=\"System.Net.Http.Headers.ProductInfoHeaderValue\" data-throw-if-not-resolved=\"false\"></xref> class provides support for the product and comment tokens values used in  a User-Agent header as defined in <see href=\"http://go.microsoft.com/fwlink/?LinkID=241642\">RFC 2616</see> by the IETF.</p>\n<p>The User-Agent field contains information about the user agent originating the request. The field can contain multiple product tokens and comments identifying the user agent and any sub-products.</p>\n"
